subroutine vdwd3_input
  use strings
  Use Numbers
  Use Parinf_module
  Use Basato_module
  Use vdwd3_module  
  Use Symbat_module
  USE MEMORY_USE
  Implicit Real(float)(a-h,o-z)
  character(len=11),PARAMETER :: znamz="DFTD3_INPUT"
  PARAMETER(NDIMD3BJ=69,NDIMD3=61,NDIMD2=13,NDIMARG=40)
  allocatable::iauxi(:)
  character(len=100) :: vdwmode,arglist(NDIMARG),arg,args(NDIMARG)
  logical :: vdwend, knownfunc
  character(len=25) :: vdwfuncdum
  character(len=13) :: vdwd3_funclist_d3bj(NDIMD3BJ),vdwd3_funclist_d3(NDIMD3),vdwd3_funclist_d2(NDIMD2)
  DATA VDWD3_FUNCLIST_D3BJ/"b-p","b-lyp","revpbe","rpbe","b97-d","pbe","rpw86-pbe","b3-lyp",   &
   "tpss","hf","tpss0","pbe0","revpbe38","pw6b95","b2-plyp","dsd-blyp", &
   "dsd-blyp-fc","bop","mpwlyp","o-lyp","pbesol","bpbe","opbe","ssb",   &
   "revssb","otpss","b3pw91","bh-lyp","revpbe0","tpssh","mpw1b95",      &
   "pwb6k","b1b95","bmk","cam-b3lyp","lc-wpbe","b2gp-plyp","ptpss",     &
   "pwpb95","hf/mixed","hf/sv","hf/minis","b3-lyp/6-31gd","hcth120",    &
   "pw1pw","pwgga","hse06","hsesol","hf3c","hf3cv","dftb","pbeh3c",     &
   "hse3c","b973c","pbesol03c","hsesol3c","hfsol3c","scan","rscan",     &
   "r2scan","r2scan0","r2scanh","r2scan50","mn15","mpwb1k",             &
   "r2scansol3c","r2scan0sol3c","r2scanpob3c","r2scan0pob3c"/
  DATA VDWD3_FUNCLIST_D3/"slater-dirac","b-lyp","b-p","b97-d","revpbe","pbe",        &
   "pbesol","rpw86-pbe","rpbe","tpss","b3-lyp","pbe0","revpbe38",       &
   "pw6b95","tpss0","b2-plyp","pwpb95","b2gp-plyp","ptpss","hf",        &
   "mpwlyp","bpbe","bh-lyp","tpssh","pwb6k","b1b95","bop","o-lyp",      &
   "o-pbe","ssb","revssb","otpss","b3pw91","revpbe0","pbe38","mpw1b95", &
   "mpwb1k","bmk","cam-b3lyp","lc-wpbe","m05","m052x","m06l","m06",     &
   "m062x","m06hf","dftb","hcth120","pw1pw","pwgga","hse06","hsesol",   &
   "hse3c","b973c","hf3c","pbeh3c","pbesol03c","hsesol3c","wb97xd3",    &
   "mn15l","scan"/
  DATA VDWD3_FUNCLIST_D2/"b-lyp","b-p","b97-d","revpbe","pbe","tpss",   &
       "b3-lyp","pbe0","pw6b95",&
       "tpss0","b2-plyp","b2gp-plyp","dsd-blyp"/
  NAF=inf(24)
  if(.not.allocated(vdw_grad))CALL CRYALLOC(VDW_GRAD,3,NAF,ZNAMZ,'VDW_GRAD')
  if(.not.allocated(vdw_grad2))CALL CRYALLOC(VDW_GRAD2,NAF*3,ZNAMZ,'VDW_GRAD2')
   vdwend=.false.
  vdwfuncdum=' '
  SCALAS6=1._FLOAT
  SCALAS8=1._FLOAT
if(inf(208).eq.2) then      
  II=1
  do
    read(iin,'(a)')arg
    if(arg.eq.'END')exit
    if(II.gt.40)exit
    call JGB_parse(arg,' ',args,nargs)
    do k=1,nargs
       arglist(II)=trim(args(k))
      II=II+1 
    enddo
  enddo
  do i=1,II
    call convert_lu(arglist(i), arglist(i))
    if(arglist(i).ne.'') then
      SELECT CASE(arglist(i))
      CASE('VERSION')
         if(arglist(i+1).ne.'') then
            call JGB_value(arglist(i+1),vdwversion,ios)
         endif
      CASE('FUNC')
      vdwfuncdum=trim(arglist(i+1))
      presentfunc=.true.
      CASE('S6')
      call JGB_value(arglist(i+1),vdws6,ios)
      presents6=.true.
      CASE('RS6')
      call JGB_value(arglist(i+1),vdwrs6,ios)
      presentrs6=.true.
      CASE('S8')
      call JGB_value(arglist(i+1),vdws8,ios)
      presents8=.true.
      CASE('RS8')
      call JGB_value(arglist(i+1),vdwrs8,ios)
      presentrs8=.true.
      CASE('A1')
      call JGB_value(arglist(i+1),vdwrs6,ios)
      presentrs6=.true.
      CASE('A2')
      call JGB_value(arglist(i+1),vdwrs8,ios)
      presentrs8=.true.
      CASE('RADIUS')
      call JGB_value(arglist(i+1),vdwradius,ios)
      vdwradius=vdwradius*vdwradius
      CASE('CNRADIUS')
      call JGB_value(arglist(i+1),vdwcnradius,ios)
      vdwcnradius=vdwcnradius*vdwcnradius
      CASE('ABCRADIUS')
      call JGB_value(arglist(i+1),vdwabcradius,ios)
      vdwabcradius=vdwabcradius*vdwabcradius
      CASE('ABC')
         vdwabc=.true.
      CASE('NOABC')
         vdwabc=.false.
      CASE('PRINTC6')
         lprint(127)=1
      CASE('RESCALES6')
         call JGB_value(arglist(i+1),SCALAS6,ios)
      WRITE(IOUT,1001)SCALAS6
      CASE('RESCALES8')
         call JGB_value(arglist(i+1),SCALAS8,ios)
      WRITE(IOUT,1002)SCALAS8
      END SELECT
   endif
end do
  if(vdwversion.eq.0)then
  WRITE(IOUT,10)
    call errvrs(0,znamz,'ERROR IN DFTD3 INPUT')    
  elseif(vdwversion.eq.2) then
    call errvrs(2,znamz,'PERFORM DISPERSION CORRECTION DFT-D2')
    WRITE(IOUT,11)
   elseif(vdwversion.eq.3) then
    call errvrs(2,znamz,'PERFORM DISPERSION CORRECTION DFT-D3 IN THE ZERO DAMPING SCHEME')
    WRITE(IOUT,12)
   elseif(vdwversion.eq.4) then
    call errvrs(2,znamz,'PERFORM DISPERSION CORRECTION DFT-D3(BJ) IN THE BECKE-JOHNSON DAMPING SCHEME')
    WRITE(IOUT,13)
  endif
  
elseif(inf(208).eq.5) then
  if(vdwversion.eq.0) then
    vdwversion=4
  endif
  inf(208)=2
  call errvrs(2,znamz,'PERFORM LATEST DISPERSION CORRECTION DFT-D3(BJ) WITH AUTOMATIC PARAMETER SETUP')
  WRITE(IOUT,14)
endif

  if(inf(224)-NAF.NE.0)THEN 
    CALL ERRVRS(1,ZNAMZ,'DFT-D3 NOT COMPATIBLE WITH POINTCHARGES')
    INF(208)=0
  ENDIF
  IF(INF(70).NE.0)THEN
    CALL ERRVRS(1,ZNAMZ,'DFT-D3 NOT COMPATIBLE WITH GHOST ATOMS')
    INF(208)=0
  ENDIF

  if(inf(170).eq.0.and.inf(408).eq.0) then
    vdwfunc='hf'
  endif
  vdwfunc=lowercase(vdwfunc)
  vdwfuncdum=lowercase(vdwfuncdum)
  
  if(presentfunc.AND.vdwfunc.ne.vdwfuncdum)then
      call errvrs(1,znamz,'FUNCTIONAL AND FUNC NOT IDENTICAL')
      call errvrs(1,znamz,'TAKE FUNC FOR PARAMETER SETUP')
      vdwfunc=vdwfuncdum
  endif
  if(vdwfunc.ne.'')then
    if(vdwversion.eq.4) then
      do i=1,NDIMD3BJ
      if(vdwfunc.NE.vdwd3_funclist_d3bj(i))CYCLE
      knownfunc=.true.
      EXIT
      enddo
    elseif(vdwversion.eq.3) then
      do i=1,NDIMD3
      if(vdwfunc.NE.vdwd3_funclist_d3(i))CYCLE
      knownfunc=.true.
      EXIT
      enddo
    elseif(vdwversion.eq.2) then
      do i=1,NDIMD2
      if(vdwfunc.NE.vdwd3_funclist_d2(i))CYCLE
      knownfunc=.true.
      EXIT
      enddo
    endif
  endif
  if(knownfunc) then
    call setfuncpar(vdwfunc,vdwversion,s6,rs6,s8,rs8,alp6)
  elseif(vdwversion.eq.2.and.presents6) then
    s6=vdws6
  elseif(vdwversion.eq.3.and.presentrs6.and.presents8) then
    rs6=vdwrs6
    s8=vdws8
  elseif(vdwversion.eq.4.and.presentrs6.and.presents8.and.presentrs8) then
    rs6=vdwrs6
    s8=vdws8
    rs8=vdwrs8
  else     
    if(vdwversion.eq.2) then
       write(IOUT,'(a)')'Parametrized functionals for DFTD2 '
       do i=1,NDIMD2
         write(IOUT,'(a12,5x)', Advance = 'No' )  VDWD3_FUNCLIST_D2(i)
         if(mod(i,5).eq.0) write(IOUT,'('' '')')
       enddo
       write(IOUT,'('' '')')       
    elseif(vdwversion.eq.3) then
       write(IOUT,'(a)')'Parametrized functionals for DFTD3(zero) '
       do i=1,NDIMD3
         write(IOUT,'(a12,5x)', Advance = 'No' )  VDWD3_FUNCLIST_D3(i)
         if(mod(i,5).eq.0) write(IOUT,'('' '')')
       enddo
       write(IOUT,'('' '')')   
    elseif(vdwversion.eq.4) then
       write(IOUT,'(a)')'Parametrized functionals for DFTD3(BJ) '
       do i=1,NDIMD3BJ
         write(IOUT,'(a12,5x)', Advance = 'No')  VDWD3_FUNCLIST_D3BJ(i)
         if(mod(i,5).eq.0) write(IOUT,'('' '')')
       enddo
       write(IOUT,'('' '')')   
    endif
    call errvrs(0,znamz,'FUNCTIONAL NOT KNOWN')
   endif

  if(vdwversion.eq.2) then
    rs6=1.1_FLOAT
    s8=0._FLOAT
    alp6=20._FLOAT
  elseif(vdwversion.eq.3) then
    s6=1._FLOAT
    alp6=14._FLOAT
  elseif(vdwversion.eq.4) then
    s6  =1._FLOAT
    alp6=14._FLOAT
  endif

  if(presents6) then
    s6=vdws6
    call errvrs(1,znamz,'USE MANUALLY DEFINED S6')
  endif
  if(presentrs6) then
    rs6=vdwrs6
    call errvrs(1,znamz,'USE MANUALLY DEFINED A1(RS6)')
  endif
  if(presents8) then
    s8=vdws8
    call errvrs(1,znamz,'USE MANUALLY DEFINED S8')
  endif
  if(presentrs8) then
    rs8=vdwrs8
    call errvrs(1,znamz,'USE MANUALLY DEFINED A2(RS8)')
  endif
  S6=SCALAS6*S6
  S8=SCALAS8*S8
  vdws6=s6
  vdwrs6=rs6
  vdws8=s8
  vdwrs8=rs8
  vdwalp6=alp6
  RETURN
10 FORMAT(/' NO DFTD3 VERSION NUMBER PROVIDED IN INPUT. KEYWORDS:'/ &
   ' VERSION 2     DFT-D2'/' VERSION 3     DFT-D3'/' VERSION 4     DFT-D3(BJ)'/)
11 FORMAT(/' PLEASE CITE:'/' (1) DFT-D2 Reference'/'  S. Grimme, J. Comput. Chem., 27 (2006), 1787-1799'/ &
   ' (2) General DFT-D Review '/ &
   '  S. Grimme, A. Hansen, J. G. Brandenburg, and C. Bannwarth,'/ '  Chem. Rev. 116 (2016), 5105-5154'/, &
   ' DFT-D3 IS LESS EMPIRIC AND MORE ACCURATE THAN DFT-D2'/ &
   ' KEYWORDS:'/'VERSION 3     DFT-D3'/'VERSION 4     DFT-D3(BJ)'/)
12 FORMAT(/' PLEASE CITE:'/' (1) DFT-D3 Reference'/'  S. Grimme, J. Antony, S. Ehrlich, and H. Krieg,', &
   ' J. Chem. Phys. 132 (2010), 154104'/' (2) General DFT-D Review'/ &
   '  S. Grimme, A. Hansen, J. G. Brandenburg, and C. Bannwarth,'/ '  Chem. Rev. 116 (2016), 5105-5154'/)
13 FORMAT(/' PLEASE CITE:'/' (1) DFT-D3 Reference'/'  S. Grimme, J. Antony, S. Ehrlich, and H. Krieg,', &
   ' J. Chem. Phys. 132 (2010), 154104'/' (2) BJ-Damping Reference'/ &
   '  S. Grimme, S. Ehrlich, and L. Goerigk, J. Comput. Chem. 32 (2011), 1456-1465'/ &
   ' (3) General DFT-D Review'/&
   '  S. Grimme, A. Hansen, J. G. Brandenburg, and C. Bannwarth,'/ '  Chem. Rev. 116 (2016), 5105-5154'/)
14 FORMAT(' PLEASE CITE:'/' (1) DFT-D3 Reference'/'  S. Grimme, J. Antony, S. Ehrlich, and H. Krieg,', &
   ' J. Chem. Phys. 132 (2010), 154104'/' (2) BJ-Damping Reference'/ &
   '  S. Grimme, S. Ehrlich, and L. Goerigk, J. Comput. Chem. 32 (2011), 1456-1465'/ &
   ' (3) General DFT-D Review'/ &
   '  S. Grimme, A. Hansen, J. G. Brandenburg, and C. Bannwarth,'/ '  Chem. Rev. 116 (2016), 5105-5154'/)
1001 FORMAT(' D3: STANDARD S6 PARAMETER IS RESCALED BY A FACTOR OF:',F10.6)
1002 FORMAT(' D3: STANDARD S8 PARAMETER IS RESCALED BY A FACTOR OF:',F10.6)
end Subroutine vdwd3_input

subroutine vdwd3_free
Use vdwd3_module
Use Symbat_module
 USE MEMORY_USE
  CALL CRYDEALLOC(VDW_GRAD2,'VDWD3_FREE','VDW_GRAD2')
  CALL CRYDEALLOC(VDW_GRAD,'VDWD3_FREE','VDW_GRAD')
endsubroutine vdwd3_free

subroutine vdwd3_calc_energy(echo)
  use Numbers
  use vdwd3_module
  use strings
  Use Parinf_module
  Use Basato_module
  Use Gvect_module
  USE XYVDIM_MODULE
  USE MEMORY_USE
  character(len=17),PARAMETER :: znamz="DFTD3 ENERGY" 
  logical :: echo,knownfunc!ale
  !number of atoms
  integer,DIMENSION(:),ALLOCATABLE :: IZ
  NAF=inf(24)
  knownfunc=.false.
  do i=1,3
    do j=1,3
      cell(i,j) = PARET(j,i)
    enddo
  enddo

  CALL CRYALLOC(IZ,NAF,ZNAMZ,'IZ')
  IZ(1:NAF)=MOD(NAT(1:NAF),100)
  if(echo) then
  WRITE(IOUT,*)
  call errvrs(2,znamz,'CALCULATE DFTD3 ENERGY')
  endif
  call pbcdftd3(iz,cell,NAF,vdw_energy,vdw_grad,vdw_cellgrad, &
                .false.,vdwfunc,echo,vdwversion,vdws6,vdwrs6,vdws8,vdwrs8,vdwalp6,&
                vdwradius,vdwcnradius,vdwabcradius,.not.vdwabc)
  CALL CRYDEALLOC(IZ,ZNAMZ,'IZ')
  if(echo) then
  call errvrs(2,znamz,'NORMAL TERMINATION OF DFTD3 MODULE')
  endif
end subroutine vdwd3_calc_energy

subroutine vdwd3_calc_energy_grad
  use Numbers
  use vdwd3_module
  use strings
  Use Parinf_module
  Use Basato_module
  Use Gvect_module
  USE XYVDIM_MODULE
  USE MEMORY_USE
  character(len=22),PARAMETER :: znamz="DFTD3 GRAD" 
  !number of atoms
  logical :: knownfunc,echo!ale 
  integer,DIMENSION(:),ALLOCATABLE :: IZ
  Real(float) :: vdw_cellgrad_dum(3,3)
  NAF=inf(24)
  knownfunc=.false.
  ldim=inf(10)
  if(lprint(127).eq.1)then
     echo=.true.
  else
     echo=.false.
  endif
  do i=1,3
    do j=1,3
      cell(i,j) = PARET(j,i)
    enddo
  enddo

  CALL CRYALLOC(IZ,NAF,ZNAMZ,'IZ')
  IZ(1:NAF)=MOD(NAT(1:NAF),100)
  if(echo) then
  call errvrs(2,znamz,' ')
  call errvrs(2,znamz,'CALCULATE DFTD3 ENERGY AND DFTD3 FORCE')
  WRITE(IOUT,'(/'' DFTD3 ENERGY AND FORCE CALCULATION'')')
  endif
  call pbcdftd3(iz,cell,NAF,vdw_energy,vdw_grad,vdw_cellgrad, &
                .true.,vdwfunc,.false.,vdwversion,vdws6,vdwrs6,vdws8,vdwrs8,vdwalp6,&
                vdwradius,vdwcnradius,vdwabcradius,.not.vdwabc)
  CALL CRYDEALLOC(IZ,ZNAMZ,'IZ')
  
  k=1
  do i=1,NAF
    do j=1,3
      vdw_grad2(k)=-vdw_grad(j,i)
      k=k+1
    enddo
  enddo
  vdw_cellgrad_dum=-vdw_cellgrad
  do i=1,3
     do j=1,3
        vdw_cellgrad(i,j)=vdw_cellgrad_dum(j,i)
     enddo
  enddo

     vdw_cellgrad2(1)=vdw_cellgrad(1,1)
     select case (ldim)
     case(2)
     vdw_cellgrad2(2)=vdw_cellgrad(1,2)
     vdw_cellgrad2(3)=vdw_cellgrad(2,1)
     vdw_cellgrad2(4)=vdw_cellgrad(2,2)
     case(3)
     vdw_cellgrad2(2)=vdw_cellgrad(1,2)
     vdw_cellgrad2(3)=vdw_cellgrad(1,3)
     vdw_cellgrad2(4)=vdw_cellgrad(2,1)
     vdw_cellgrad2(5)=vdw_cellgrad(2,2)
     vdw_cellgrad2(6)=vdw_cellgrad(2,3)
     vdw_cellgrad2(7)=vdw_cellgrad(3,1)
     vdw_cellgrad2(8)=vdw_cellgrad(3,2)
     vdw_cellgrad2(9)=vdw_cellgrad(3,3)
     end select  
     if(echo) then
  call errvrs(2,znamz,'NORMAL TERMINATION OF DFTD3 MODULE')
  endif
end subroutine vdwd3_calc_energy_grad
